import React from 'react';
import './Navbar.css';

import './Button_style.css';

function Navba() {
  return (
    <nav>
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>

      </ul>
    </nav>
  );
}

export default Navbar;
